window.bookSummaryJSON = "<p><b>What the Fae King wants.... He gets.</b></p> <p><b>Xander</b></p> <p>I’m used to getting anything I want.</p> <p>Power. Fame. Women.</p> <p>It’s all mine, but boredom has set in after 500 years as the Fae King and ruling mankind.</p> <p>She’s the only thing that excites me.</p> <p>She’s forbidden, but that won't stop me from making her mine.</p> <p><b>Gabriella</b></p> <p>I’ve trained all my life for this moment.</p> <p>My ascension - to gain my wings and join the Celestial Royals.</p> <p>Only, the Fae King had other plans. He ruined everything when he crashed the party and kidnapped me.</p> <p>He thinks this is all a game. My life. My purity. My purpose.</p> <p>I have to escape him or everyone I love will die. For if I don’t ascend, the world will fall into chaos, and sin will reign on earth.</p> <p>Knowing the Fae King, that was his plan all along.</p> <p><i>Captured by the Fae King is Book 1 in a slow burn Paranormal Romance Series. This book contains sexual situations, strong language, and violence.</i></p>"; 
